import axios from 'axios';
import VueAxios from 'vue-axios';
export default {
  name: 'Catalogue',
  props: {
    msg: String
  },
  data: function data() {
    return {
      countryId: this.$route.params.countryId,
      catalogues: []
    };
  },
  created: function created() {
    this.$parent.showHeader = true;
  },
  mounted: function mounted() {
    var _this = this;

    axios.get('https://onlinedatabasetool.com/api/catalogexists/' + this.$route.params.countryId).then(function (response) {
      return _this.catalogues = response;
    });
  }
};
